import './App.css';
import PrintArticle from './Article';
import TaskPrint from './Task';

const tasks = [
  { title: 'Apprendre React', completed: true },
  { title: 'Créer un projet React', completed: false },
  { title: 'Comprendre les props', completed: true },
  { title: 'Déployer une application React', completed: false }
];

function Print() {
  return <h1>Hello World</h1>;
}

function UserCard() {
  const user = {
    name: "Alice Dupont",
    age: 38,
    job: "Développeuse Web",
    location: "Paris, France"
  };

  return (
    <div className="result">
      <p>Nom : {user.name}</p>
      <p>Age : {user.age}</p>
      <p>Job : {user.job}</p>
      <p>Location : {user.location}</p>
      {user.age<30?<p> jeune </p>:<p>vieux</p>}
    </div>
  );
}

function App() {
  return (
    <div className="App">
      <div className="header">
        <Print />
        <UserCard />
        <PrintArticle titre='test1' description="blablalblab"/>
        <TaskPrint/>
      </div>
    </div>
  );
}

export default App;
